    "def neighboors(line,p):\n",
    "    ''''''\n",
    "    LR=[]\n",
    "    return [line[i] for i in range(max(0,p-1),min(len(line),p+2)) if i!=p]\n",
    "\n",
    "\n",
    "def proximity(p,q,world):\n",
    "    ''''''\n",
    "    L=[]\n",
    "    for i in range (0,len(world)):\n",
    "        L.append(world[i][q]) \n",
