    "    if p<len(world)-1:\n",
    "        if q>0:\n",
    "            L_neighboors.append(world[p+1][q-1])\n",
    "        if q<len(world[p])-1:\n",
    "            L_neighboors.append(world[p+1][q+1])\n",
    "                        \n",
    "    return L_neighboors\n",
    "\n",
